import React from 'react';
import logo from './logo.svg';
import {Component} from 'react';
import './LandingPage.css';

export interface ILandingPageProps {

}

export interface ILandingPageState {
  activeTab: number
}

class LandingPage extends Component<ILandingPageProps, ILandingPageState> {
  constructor(props: ILandingPageProps) {
    super(props);
    this.state = {
      activeTab: 1
    }
  }

  setActiveTab = (tab: number) => {
    this.setState({
      activeTab: tab
    })
  }

  render() {
    return (
      <div className="landing-page-main-container">
      <div className="lp-top-row">
      <div className="float-left logo">
      <img src="../src/logo.png"></img>
      </div>
      <div className="float-right menu">
      <ul className="nav justify-content-end">
      <li className="nav-item">
        <button className="nav-link" onClick={this.setActiveTab(1)}>Pledge</button>
      </li>
      <li className="nav-item">
        <button className="nav-link" onClick={this.setActiveTab(2)}>Registration</button>
      </li>
      </ul>
      </div>
      </div>
      </div>
    );
  }
}

export default LandingPage;
